10.body:
Allows you to create a script that eww runs. Useful for creating volume sliders or anything similar. Example: <variables> <script-var name="date" interval="5s"> date +%H:%M </script-var>
</variables> and then reference it by doing: <box> {{date}}
</box> The interval="5s" part says how long time it should take before Eww runs the command again. Here are the available times you can set: Shortened Full name ms Miliseconds s Seconds m Minutes h Hours

9.body:
Allows you to repeat the same text multiple times through without retyping it multiple times. Example: This will define a variable named banana, with the default value "I like bananas." <variables> <var name="banana">I like bananas.</var>
</variables> You can then reference it in your widgets by doing: <box> {{banana}}
</box> To change the value of the variable, and thus change the UI, you can run eww update banana "I like apples"
